insert  into `faqs`(`id`,`category_id`,`question`,`slug`,`answers`,`is_active`,`created`,`modified`) values (1,59,'Who can join','Who-can-join','<p>Anyone who has money can join the FoxHopr.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://i.forbesimg.com/media/lists/companies/google_416x416.jpg\" style=\"border-style:solid; border-width:4px; float:right; height:200px; margin:4px; width:200px\" /></p>',1,'2015-05-13 07:48:03','2015-10-26 10:51:56'),(2,59,'How can I join','How-can-I-join','<p>We&#39;ll start off with the navigation bar which is located at the top of the page after you log into your account at&nbsp;<a href=\"http://www.dropcam.com/\">www.dropcam.com</a></p>\r\n\r\n<p>On the left side of the navigation bar is the Dropcam icon. Clicking on this takes you back to the main&nbsp;<a href=\"http://www.dropcam.com/\">www.dropcam.com</a>&nbsp;webpage where you can purchase additional cameras, check out camera specifications, or view some of our Live Demo cameras.&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"http://support.dropcam.com/attachments/token/ehrp6zh6xrxanov/?name=NavBar2%28edited2%29.png\" /></p>',1,'2015-05-13 07:48:13','2015-10-26 10:54:28'),(3,59,'What if my profession is not listed','What-if-my-profession-is-not-listed','',1,'2015-05-13 07:48:24','2015-05-13 02:18:24'),(5,59,'How do I become a leader','How-do-I-become-a-leader','',1,'2015-05-13 07:48:50','2015-05-13 02:18:50'),(6,59,'Do I have to work in my profession full-time','Do-I-have-to-work-in-my-profession-full-time','',1,'2015-05-13 07:48:59','2015-05-13 02:18:59'),(7,59,'Join via computer demo','Join-via-computer-demo','',1,'2015-05-13 07:50:20','2015-05-13 02:20:20'),(8,59,'Join via smartphone demo','Join-via-smartphone-demo','',1,'2015-05-13 07:50:28','2015-05-13 02:20:28'),(9,59,'Join via tablet demo','Join-via-tablet-demo','',1,'2015-05-13 07:50:36','2015-05-13 02:20:36'),(10,59,'Is there a Foxhopr app for Blackberry','Is-there-a-Foxhopr-app-for-Blackberry','',1,'2015-