/*Table structure for table `group_change_requests` */

DROP TABLE IF EXISTS `group_change_requests`;

CREATE TABLE `group_change_requests` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `business_owner_id` int(11) unsigned NOT NULL,
  `profession_id` int(11) NOT NULL,
  `group_id` int(11) NOT NULL,
  `proposed_meeting_time` time NOT NULL,
  `request_type` enum('cr','k_off') NOT NULL COMMENT 'cr: Group change k_off: kicked off',
  `is_moved` tinyint(1) NOT NULL DEFAULT '0',
  `created` datetime NOT NULL,
  `modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

/*Data for the table `group_change_requests` */

/*Table structure for table `groups` */

DROP TABLE IF EXISTS `groups`;

CREATE TABLE `groups` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `group_name` varchar(255) NOT NULL,
  `group_type` enum('global','local') NOT NULL,
  `first_meeting_date` date DEFAULT NULL,
  `second_meeting_date` date DEFAULT NULL,
  `meeting_time` time DEFAULT NULL,
  `country_id` char(2) DEFAULT NULL,
  `state_id` int(4) unsigned DEFAULT NULL,
  `city` varchar(40) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `zipcode` varchar(12) DEFAULT NULL,
  `lat` varchar(20) DEFAULT NULL,
  `long` varchar(20) DEFAULT NULL,
  `timezone_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `total_member` int(11) DEFAULT '0',
  `group_professions` varchar(100) NOT NULL,
  `group_leader_id` int(11) unsigned DEFAULT NULL,
  `group_coleader_id` int(11) unsigned DEFAULT NULL,
  `shuffling_date` date DEFAULT NULL,
  `group_created_by` int(11) unsigned DEFAULT NULL,
  `group_modified_by` int(11) unsigned DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '0',
  `created` datetime NOT NULL,
  `modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

