/*Table structure for table `received_referrals` */

DROP TABLE IF EXISTS `received_referrals`;

CREATE TABLE `received_referrals` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `from_user_id` int(11) unsigned NOT NULL,
  `to_user_id` int(11) unsigned NOT NULL,
  `group_id` int(11) unsigned NOT NULL,
  `first_name` varchar(20) NOT NULL,
  `last_name` varchar(20) NOT NULL,
  `company` varchar(35) NOT NULL,
  `job_title` varchar(35) NOT NULL,
  `address` varchar(60) NOT NULL,
  `country_id` char(2) CHARACTER SET latin1 DEFAULT NULL,
  `state_id` int(10) unsigned DEFAULT NULL,
  `city` varchar(35) NOT NULL,
  `zip` varchar(12) NOT NULL,
  `office_phone` varchar(15) NOT NULL,
  `mobile` varchar(15) NOT NULL,
  `email` varchar(80) NOT NULL,
  `website` varchar(100) NOT NULL,
  `message` varchar(500) NOT NULL,
  `files` text NOT NULL,
  `referral_status` varchar(50) DEFAULT 'received',
  `rating_status` tinyint(1) NOT NULL DEFAULT '0',
  `monetary_value` bigint(11) DEFAULT NULL,
  `is_read` tinyint(1) NOT NULL DEFAULT '0',
  `is_total_read` tinyint(1) NOT NULL DEFAULT '0',
  `is_archive` tinyint(1) NOT NULL DEFAULT '0',
  `created` datetime NOT NULL,
  `modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

