insert  into `webcasts`(`id`,`title`,`slug`,`description`,`link`,`created`,`modified`) values (83,'KIDS REACT TO ROTARY PHONES','KIDS-REACT-TO-ROTARY-PHONES','The \"Kids React to Old Computers\" video is the latest in a series posted to YouTube from Fine Brothers Entertainment.\r\n\r\nThe video was done in partnership with AMC\'s \"Halt & Catch Fire Show\" and the result is downright hilarious','https://www.youtube.com/watch?v=XkuirEweZvM','2015-12-09 09:00:24','2015-12-09 09:00:24'),(84,'Dot Net Demo Lectures','Dot-Net-Demo-Lectures','Hello Friends , This is Demo Lecture of Dot Net. In this video we can clear all concept of Dot Net. What is Dot Net ?? This video created by Professional Computer Institute for whose those interested to do learn Dot Net Technology. This Demo Lecture ','https://www.youtube.com/watch?v=ldrmaA72PJg','2015-12-09 09:01:16','2015-12-09 09:01:16'),(85,'Easy to learn dot net step by step Lesson1.f4v','Easy-to-learn-dot-net-step-by-step-Lesson1-f4v','','https://www.youtube.com/watch?v=ZKDxDZ2GuLc','2015-12-09 09:01:47','2015-12-09 09:01:47'),(86,'Adobe Connect Meeting Overview','Adobe-Connect-Meeting-Overview','A video overview of Adobe Connect meeting. Updated for Adobe Connect 8.1','https://www.youtube.com/watch?v=Oyx_hutZtzA','2015-12-09 09:02:53','2015-12-09 09:02:53'),(87,'Adobe Connect Recordings','Adobe-Connect-Recordings','In this video, Alistair Lee walks through how to access and edit Adobe Connect recordings','https://www.youtube.com/watch?v=sB9vBbXXQZU','2015-12-09 09:03:22','2015-12-09 09:03:22'),(88,'Distributing and Tracking Adobe Connect Recordings','Distributing-and-Tracking-Adobe-Connect-Recordings','This short video shows how to access, distribute, and track Adobe Connect meeting recordings','https://www.youtube.com/watch?v=5-W74SVbxb0','2015-12-09 09:04:11','2015-12-09 09:04:11'),(89,'Adobe Connect Reports','Adobe-Connect-Reports','This video walks through several different methods for finding the data you need from Adobe C