/* Trigger structure for table `business_owners` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `update_user_group_history` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'caregiving'@'%' */ /*!50003 TRIGGER `update_user_group_history` BEFORE UPDATE ON `business_owners` FOR EACH ROW BEGIN
	IF OLD.group_id IS NULL THEN
	INSERT INTO user_group_history (user_id, group_id, group_join_date) VALUES (NEW.user_id, NEW.group_id, NOW());
	ELSEIF OLD.group_id != NEW.group_id THEN
	UPDATE user_group_history SET group_leave_date = NOW() WHERE user_id = OLD.user_id AND group_id = OLD.group_id;
	INSERT INTO user_group_history (user_id, group_id, group_join_date) VALUES (NEW.user_id, NEW.group_id, NOW());
	END IF;
    END */$$


DELIMITER ;

/* Trigger structure for table `groups` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `insert_shufflingdate` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'caregiving'@'%' */ /*!50003 TRIGGER `insert_shufflingdate` BEFORE INSERT ON `groups` FOR EACH ROW SET NEW.shuffling_date = DATE_ADD( NOW( ) , INTERVAL 91 DAY ) */$$


DELIMITER ;

